import React from 'react';
import { Typography, Link, IconButton } from '@mui/material';
import { GitHub, LinkedIn } from '@mui/icons-material';
import { styled } from '@mui/system';

const FooterContainer = styled('footer')({
  backgroundColor: '#8e8e8e',
  color: '#fff',
  padding: '20px',
  textAlign: 'center',
  position: 'relative',
  bottom: 0,
  width: '100%',
  overflow: 'hidden',
  maxHeight: '10vh',
});

const Footer = () => {
  return (
    <FooterContainer>
      <Typography variant="body1">
        © {new Date().getFullYear()} Júlio Gonçalves.
      </Typography>
      <IconButton color="inherit" component={Link} href="https://github.com/juliogoncalves147">
          <GitHub />
        </IconButton>
      <Typography variant="body2">
        All rights reserved.
      </Typography>
      <IconButton color="inherit" component={Link} href="https://www.linkedin.com/in/juliogoncalvess/">
          <LinkedIn />
        </IconButton>
    </FooterContainer>
  );
};

export default Footer;
